import React from 'react';



function Workouts() {
    return (
        <div className="hero">
            <div className="hero-content">
                <div className="text-content">
                    <h1>Ready. Set.</h1>
                    <h2>Workout plan for the week</h2>
                    <p>Be the best version of yourself.</p>
                </div>
                <div className="feature-image">
                    <img src="exercising-image.png" alt="Exercise Illustration" />
                </div>
            </div>
        </div>
    );
}

function WorkoutContent() {
    return (
      <div className="blog">
        <h1>Blog Posts</h1>
        <div className="blog-posts">
          {sampleBlogPosts.map((post) => (
            <div key={post.id} className="blog-post">
              <div className="text-content">
                <h2>{post.title}</h2>
                <p>{post.content}</p>
              </div>
              <div className="">
                <img src={post.imageUrl} alt={post.altText} />
                <p className="date-blog">Date: {post.date.toDateString()}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  }

export default Workouts;
